import React from 'react';
import {BrowserRouter as Router, Route, Routes} from "react-router-dom";
import Header from './front/Header';
import {Home} from './front/Home';

function App() {
  return (
    <div className="App">
      <Router>
      <Header />     
        <Routes>
          <Route path="/" element={<Home />}></Route>
        </Routes>
    </Router>
    </div>
  );
}

export default App;
